INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (12,4,'2016-05-18 12:19:08.000','2016-05-18 12:19:08.000','<p>Villa Mykonos Aqua Pearl has a fabulous location in Tourlos, on the northwest coast of the Greek Cyclades island of Mykonos. It is just a few kilometres from the islands capital Chora, the fabulous sandy beach of Agios Stefanos, and Mykonos airport and port.</p>\r\n<p>&nbsp;</p>\r\n<p><br />\r\n<strong>Distances:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>To town:</strong> 2.9 km<br />\r\n<strong>To Ag. Stefanos beach:</strong> 2.8 km<br />\r\n<strong>To closest shop:</strong> 2.9 km<br />\r\n<strong>To Mykonos Airport:</strong> 4.6 Km<br />\r\n<strong>To new port:</strong> 2.3 km</p>','Location','','publish','closed','closed','','location','','','2016-05-25 12:31:49.000','2016-05-25 12:31:49.000','',0,'http://www.villamykonosaquapearl.gr/?page_id=12',0,'page','',0);
