INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (14,4,'2016-05-18 12:20:23.000','2016-05-18 12:20:23.000','<p>The Villa Mykonos Aqua Pearl offers a range of top quality luxury features, facilities and services to make your stay in Mykonos as relaxing and enjoyable as possible.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features &amp; Facilities:</strong></p>\r\n<ul>\r\n\t<li>Panoramic Sea View</li>\r\n\t<li>A/C in all Rooms</li>\r\n\t<li>Fully Equipped kitchen</li>\r\n\t<li>BBQ</li>\r\n<li>Private swimming pool</li>\r\n<li>Pool terrace</li>\r\n<li>Flat screen TV in each room</li>\r\n<li>Sat TV</li>\r\n<li>Home Cinema</li>\r\n<li>Outdoor audio system</li>\r\n<li>Wi-Fi Internet Access</li>\r\n<li>Hair dryer</li>\r\n<li>Private parking area\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Services:</strong></p>\r\n<ul>\r\n\t<li>Airport meet & greet</li>\r\n<li>Daily maid service</li>\r\n<li>Bathroom amenities</li>\r\n<li>Change of linen twice a week</li>\r\n<li>Maintenance of the surrounding area and the pool\r\n</li>\r\n</ul>','Facilities & Services','','publish','closed','closed','','facilities-services','','','2016-05-25 12:30:57.000','2016-05-25 12:30:57.000','',0,'http://www.villamykonosaquapearl.gr/?page_id=14',0,'page','',0);
