INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (16,4,'2016-05-18 12:24:35.000','2016-05-18 12:24:35.000','<p>Villa Mykonos Aqua Pearl is a newly build 460 m2 villa, perched on the hill in Tourlos, in northwest Mykonos. The villa offers unobstructed panoramic views of the Aegean Sea, the new harbor, Mykonos town, and amazing sunsets views.</p>\r\n<p>&nbsp;</p>\r\n<p>The interior and exterior architectural design of Villa Mykonos Aqua Pearl combines a minimal modern aesthetic with a timelessly elegant style that that complements the natural surroundings, whilst at the same time offering excellent privacy for total relaxation.</p>\r\n<p>&nbsp;</p>\r\n<p>Tourlos is one of the best regions on the island of Mykonos and it is a popular choice for many celebrities visiting Mykonos. It combines the best of both worlds, with easy access to the nearby Mykonos town (Chora), but also offering great privacy and a variety of different entertainment options.</p>','About','','publish','closed','closed','','about','','','2016-05-25 13:08:03.000','2016-05-25 13:08:03.000','',0,'http://www.villamykonosaquapearl.gr/?page_id=16',0,'page','',0);
