INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (18,4,'2016-05-18 12:24:52.000','2016-05-18 12:24:52.000','<p>Welcome to Villa Sophia which is situated on the South West coast of Mykonos with a breathtaking view of Ornos Bay and in the distance _ittle Venice and the famous capital of Mykonos  Chora.</p><p>Villa Sophia was renovated in 2012 by her present owners with on exclusive interior design that well suits the Myconian style. Villa Sophia promises a comfortable, memorable and relaxing experience with your family or group of friends in the luxurious accommodation for 8-9 guests.</p>','The Villa','','publish','closed','closed','','the-villa','','','2017-12-29 04:16:24.000','2017-12-29 04:16:24.000','',0,'http://www.villamykonosaquapearl.gr/?post_type=room&#038;p=18',0,'room','',0);
