INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (20,4,'2016-05-18 12:26:18.000','2016-05-18 12:26:18.000','<p>The upper level of Villa Mykonos Aqua Pearl has a large living room with sofas and a fireplace. There is also a dining area for the whole party to enjoy meals together, and a guest WC The Upper Level is also home to the villas fully equipped open plan kitchen with a beautiful skylight. The Master Bedroom of the villa is also located on the upper level, and has its own en-suite bathroom. There is also a double bedroom on this level too, also with its own en-suite bathroom.</p>','Upper Level','','publish','closed','closed','','upper-level','','','2016-05-25 13:22:50.000','2016-05-25 13:22:50.000','',0,'http://www.villamykonosaquapearl.gr/?post_type=room&#038;p=20',0,'room','',0);
