INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (22,4,'2016-05-18 12:26:31.000','2016-05-18 12:26:31.000','<p>The lower level of Villa Mykonos Aqua Pearl has a spacious living room in which to relax and unwind, as well as a fully equipped home cinema room to keep everyone entertained. There are also 3 Master bedrooms, all with their own lounges and bathrooms. The lower level also houses a staff room with a single bed and ensuite bathroom. Outside, there is one exterior guest room that uses the pool bathroom.</p>','Lower Level','','publish','closed','closed','','lower-level','','','2016-05-25 13:15:41.000','2016-05-25 13:15:41.000','',0,'http://www.villamykonosaquapearl.gr/?post_type=room&#038;p=22',0,'room','',0);
