INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (24,4,'2016-05-18 12:26:48.000','2016-05-18 12:26:48.000','<p>Outside the villa there is plenty of space to cater for the whole villa party, including a private parking area for 6 cars. Outdoor sitting, lounge and dining areas featuring built in benches and tables are the perfect spot to enjoy unforgettable moments with family and friends whilst admiring the stunning sea view and sunset. The BBQ offers the opportunity for group cooking and meals, while the covered pergolas are the perfect place to retreat to enjoy a cooling drink in the shade. The spectacular swimming pool will be popular with young and old alike, and features loungers and sunbeds  ideal for soaking up some sunshine as you float peacefully in the water.</p>','Outdoors','','publish','closed','closed','','outdoors','','','2016-05-25 12:27:28.000','2016-05-25 12:27:28.000','',0,'http://www.villamykonosaquapearl.gr/?post_type=room&#038;p=24',0,'room','',0);
