INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (65,4,'2016-05-20 13:03:28.000','2016-05-20 13:03:28.000','<p style=\"text-align: left;\"><strong>Guests: 15 | Bedrooms: 8 | Bathrooms: 9</strong></p><p>&nbsp;</p><p>Villa Mykonos Aqua Pearl is built on a plot covering an area of 2300 m2. It is ideally located to provide stunning panoramic views of the sea and Mykonos island, and is also sheltered from Mykonos\' strong north summer winds called Meltemia. The villa has a 360 m2 building area spread in two levels, plus spacious outdoor grounds with a private swimming pool and dining area.</p><p>&nbsp;</p><p><br /> As you enter the property from the main driveway entrance, two parking spaces wait for your cars. Descending a few stairs, the guest walks through the stone entrance of the villa and down to the villa\'s first level. The entrance is through a large hall, leading to the dining room.</p><p>&nbsp;</p><p><br /> On the right of the hall you will find a cozy living room with a fireplace. The living room opens out onto a large terrace with outdoor seating area and breathtaking views. On the left side of the hall, is the villa\'s kitchen. This open plan kitchen is literally carved into the rock of the villa and light from the skylight washes in, bathing the room in warm Mediterranean sunshine. Next to the kitchen you can find the internal staircase.</p><p>&nbsp;</p><p><br /> A few steps down and you will find yourself in one of four double bedrooms (all en-suite). This bedroom has its own entrance, allowing it to operate as a guest room or playroom. Going up, one can find the second bedroom, and just above that is the main bedroom which has its own terrace. Immediately after is the fourth bedroom, which also has its own independent entrance.</p><p>&nbsp;</p><p><br /> Outside the villa and descending the stairs of the terrace, the guest reaches the second level, which houses an outdoor dining area with a stone built table. Finally, descending to the infinity pool level, a large lounge area and the bar are waiting for you.</p><p>&nbsp;</p><p><br /> Whichever level of Villa Mykonos Aqua Pearl you happen to be enjoying, the view of the Aegean Sea is always extraordinary and unforgettable!</p>','The Villa','','inherit','closed','closed','','18-autosave-v1','','','2016-05-20 13:03:28.000','2016-05-20 13:03:28.000','',18,'http://www.villamykonosaquapearl.gr/2016/05/18/18-autosave-v1/',0,'revision','',0);
