INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (182,4,'2016-05-19 12:49:26.000','2016-05-19 12:49:26.000','<p>The lower level of the villa has a spacious living room in which to relax and unwind, as well as a fully equipped home cinema room to keep everyone entertained. There are also 3 master bedrooms, all with their own lounges and bathrooms. The lower level also houses a staff room with a single bed and ensuite bathroom. Outside, there are two guest houses, one exterior guest house that uses the pool bathroom, and one large 60m2 guest house featuring a king size bed and en-suite bathroom.</p>','Lower Level','','inherit','closed','closed','','22-revision-v1','','','2016-05-19 12:49:26.000','2016-05-19 12:49:26.000','',22,'http://www.villamykonosaquapearl.gr/2016/05/19/22-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (183,4,'2016-05-19 12:52:11.000','2016-05-19 12:52:11.000','','Outdoors','','inherit','closed','closed','','24-autosave-v1','','','2016-05-19 12:52:11.000','2016-05-19 12:52:11.000','',24,'http://www.villamykonosaquapearl.gr/2016/05/19/24-autosave-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (184,4,'2016-05-19 12:59:35.000','2016-05-19 12:59:35.000','<p>Outside the villa there is plenty of space to cater for the whole villa party, including a private parking area for 6 cars. Outdoor sitting, lounge and dining areas featuring built in benches and tables are the perfect spot to enjoy unforgettable moments with family and friends whilst admiring the stunning sea view and sunset. The BBQ offers the opportunity for group cooking and meals, while the covered pergolas are the perfect place to retreat to enjoy a cooling drink in the shade. The spectacular swimming pool will be popular with young and old alike, and features loungers and sunbeds - ideal for soaking up some sunshine as you float peacefully in the water.</p>','Outdoors','','inherit','closed','closed','','24-revision-v1','','','2016-05-19 12:59:35.000','2016-05-19 12:59:35.000','',24,'http://www.villamykonosaquapearl.gr/2016/05/19/24-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (185,4,'2016-05-19 13:10:07.000','2016-05-19 13:10:07.000','<p>The Upper Level of the villa has a large living room with sofas and a fireplace. There is also a dining area for the whole party to enjoy meals together, and a guest WC The Upper Level is also home to the villa\'s fully equipped open plan kitchen with a beautiful skylight. The Master Bedroom of the villa is also located on the upper level, and has its own private bathroom. There is also a double bedroom on this level too, also with its own private bathroom.</p>','Upper Level','','inherit','closed','closed','','20-autosave-v1','','','2016-05-19 13:10:07.000','2016-05-19 13:10:07.000','',20,'http://www.villamykonosaquapearl.gr/2016/05/19/20-autosave-v1/',0,'revision','',0);
