INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (202,4,'2016-05-20 12:29:50.000','2016-05-20 12:29:50.000','<p>Villa Mykonos Aqua Pearl is a newly build 460 m2 villa, perched on the hill in Tourlos, in northwest Mykonos. The villa offers unobstructed panoramic views of the Aegean Sea, the new harbor, Mykonos town, and amazing sunsets views.</p><p>&nbsp;</p><p>The interior and exterior architectural design of Villa Mykonos Aqua Pearl combines a minimal modern aesthetic with a timelessly elegant style that that complements the natural surroundings, whilst at the same time offering excellent privacy for total relaxation.</p><p>&nbsp;</p><p>Tourlos is one of the best regions on the island of Mykonos and it is a popular choice for many celebrities visiting Mykonos. It combines the best of worlds, with easy access to the nearby Mykonos town (Chora), but also offering great privacy and a variety of different entertainment options.</p>','About','','inherit','closed','closed','','16-revision-v1','','','2016-05-20 12:29:50.000','2016-05-20 12:29:50.000','',16,'http://www.villamykonosaquapearl.gr/2016/05/20/16-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (203,4,'2016-05-20 12:32:08.000','2016-05-20 12:32:08.000','<p style=\"text-align: center;\">Paradise and a magical holiday await you at the stunning Villa Mykonos Aqua Pearl. Relax and unwind in opulent luxury in this beautiful and stylish multi-level villa whilst enjoying incredible panoramic sea views and romantic sunsets.</p><p>&nbsp;</p><p style=\"text-align: center;\">The Villa Mykonos Aqua Pearl cancomfortably accommodate 15 guests in gorgeously designed and spacious surroundings, lavishly appointed with top quality features and facilities.</p>','Homepage','','inherit','closed','closed','','8-revision-v1','','','2016-05-20 12:32:08.000','2016-05-20 12:32:08.000','',8,'http://www.villamykonosaquapearl.gr/2016/05/20/8-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (204,4,'2016-05-20 12:33:53.000','2016-05-20 12:33:53.000','<p style=\"text-align: left;\"><strong>Guests: 15 | Bedrooms: 8 | Bathrooms: 9</strong></p><p>&nbsp;</p><p>Villa Mykonos Aqua Pearl is built on a plot covering an area of 2300 m2. It is ideally located to provide stunning panoramic views of the sea and Mykonos island, and is also sheltered from Mykonos\' strong north summer winds called Meltemia. The villa has a 360 m2 building area spread in two levels, plus spacious outdoor grounds with a private swimming pool and dining area.</p><p>&nbsp;</p><p><br /> As you enter the property from the main driveway entrance, two parking spaces wait for your cars. Descending a few stairs, the guest walks through the stone entrance of the villa and down to the villa\'s first level. The entrance is through a large hall, leading to the dining room.</p><p>&nbsp;</p><p><br /> On the right of the hall you will find a cozy living room with a fireplace. The living room opens out onto a large terrace with outdoor seating area and breathtaking views. On the left side of the hall, is the villa\'s kitchen. This open plan kitchen is literally carved into the rock of the villa and light from the skylight washes in, bathing the room in warm Mediterranean sunshine. Next to the kitchen you can find the internal staircase.</p><p>&nbsp;</p><p><br /> A few steps down and you will find yourself in one of four double bedrooms (all en-suite). This bedroom has its own entrance, allowing it to operate as a guest room or playroom. Going up, one can find the second bedroom, and just above that is the main bedroom which has its own terrace. Immediately after is the fourth bedroom, which also has its own independent entrance.</p><p>&nbsp;</p><p><br /> Outside the villa and descending the stairs of the terrace, the guest reaches the second level, which houses an outdoor dining area with a stone built table. Finally, descending to the infinity pool level, a large lounge area and the bar are waiting for you.</p><p>&nbsp;</p><p><br /> Whichever level of the villa you happen to be enjoying, the view of the Aegean Sea is always extraordinary and unforgettable!</p>','The Villa','','inherit','closed','closed','','18-revision-v1','','','2016-05-20 12:33:53.000','2016-05-20 12:33:53.000','',18,'http://www.villamykonosaquapearl.gr/2016/05/20/18-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (205,4,'2016-05-20 12:51:40.000','2016-05-20 12:51:40.000','<p>The Upper Level of Villa Mykonos Aqua Pearl has a large living room with sofas and a fireplace. There is also a dining area for the whole party to enjoy meals together, and a guest WC The Upper Level is also home to the villa\'s fully equipped open plan kitchen with a beautiful skylight. The Master Bedroom of the villa is also located on the upper level, and has its own private bathroom. There is also a double bedroom on this level too, also with its own private bathroom.</p>','Upper Level','','inherit','closed','closed','','20-revision-v1','','','2016-05-20 12:51:40.000','2016-05-20 12:51:40.000','',20,'http://www.villamykonosaquapearl.gr/2016/05/20/20-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (206,4,'2016-05-20 12:52:51.000','2016-05-20 12:52:51.000','<p>Villa Mykonos Aqua Pearl has a fabulous location in Tourlos, on the northwest coast of the Greek Cyclades island of Mykonos. It is just a few kilometres from the islands capital Chora, the fabulous sandy beach of Agios Stefanos, and Mykonos airport and port.</p><p>&nbsp;</p><p><br /><strong>Distances:</strong></p><p>&nbsp;</p><p><strong>To town:</strong> 2.9 km<br /><strong>To Ag. Stefanos beach:</strong> 2.8 km<br /><strong>To closest shop:</strong> 2.9 km<br /><strong>To Mykonos Airport:</strong> 4.6 Km<br /><strong>To new port:</strong> 2.3 km</p>','Location','','inherit','closed','closed','','12-revision-v1','','','2016-05-20 12:52:51.000','2016-05-20 12:52:51.000','',12,'http://www.villamykonosaquapearl.gr/2016/05/20/12-revision-v1/',0,'revision','',0);
