INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (212,4,'2016-05-20 13:04:56.000','2016-05-20 13:04:56.000','<p>The Villa Mykonos Aqua Pearloffers a range of top quality luxury features, facilities and services to make your stay in Mykonos as relaxing and enjoyable as possible.</p><p>&nbsp;</p><p><strong>Features &amp; Facilities:</strong></p><ul><li>Private swimming pool</li><li>Pool terrace</li><li>Flat screen TV in each room</li><li>Sat TV</li><li>DVD/CD player</li><li>Outdoor audio system</li><li>Wi-Fi Internet Access</li><li>Hair dryer</li><li>Private parking area</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><strong>Services:</strong></p><ul><li>Airport meet &amp; greet</li><li>Daily maid service</li><li>Bathroom amenities</li><li>Change of linen twice a week</li><li>Maintenance of the surrounding area and the pool</li></ul><p>&nbsp;</p><p>&nbsp;</p>','Facilities & Services','','inherit','closed','closed','','14-revision-v1','','','2016-05-20 13:04:56.000','2016-05-20 13:04:56.000','',14,'http://www.villamykonosaquapearl.gr/2016/05/20/14-revision-v1/',0,'revision','',0);
