INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (225,1,'2016-05-25 10:57:45.000','2016-05-25 10:57:45.000','<p Paradise and a magical holiday await you at the stunning Villa Mykonos Aqua Pearl. Relax and unwind in opulent luxury in this beautiful and stylish multi-level villa whilst enjoying incredible panoramic sea views and romantic sunsets.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">The Villa Mykonos Aqua Pearl can comfortably accommodate 15 guests in gorgeously designed and spacious surroundings, lavishly appointed with top quality features and facilities.</p>','Homepage','','inherit','closed','closed','','8-revision-v1','','','2016-05-25 10:57:45.000','2016-05-25 10:57:45.000','',8,'http://www.villamykonosaquapearl.gr/2016/05/25/8-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (226,1,'2016-05-25 10:58:04.000','2016-05-25 10:58:04.000','<p style=\"text-align: center;\">Paradise and a magical holiday await you at the stunning Villa Mykonos Aqua Pearl. Relax and unwind in opulent luxury in this beautiful and stylish multi-level villa whilst enjoying incredible panoramic sea views and romantic sunsets.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">The Villa Mykonos Aqua Pearl can comfortably accommodate 15 guests in gorgeously designed and spacious surroundings, lavishly appointed with top quality features and facilities.</p>','Homepage','','inherit','closed','closed','','8-revision-v1','','','2016-05-25 10:58:04.000','2016-05-25 10:58:04.000','',8,'http://www.villamykonosaquapearl.gr/2016/05/25/8-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (227,1,'2016-05-25 10:59:45.000','2016-05-25 10:59:45.000','<p>Villa Mykonos Aqua Pearl is a newly build 460 m2 villa, perched on the hill in Tourlos, in northwest Mykonos. The villa offers unobstructed panoramic views of the Aegean Sea, the new harbor, Mykonos town, and amazing sunsets views.</p>\r\n<p>&nbsp;</p>\r\n<p>The interior and exterior architectural design of Villa Mykonos Aqua Pearl combines a minimal modern aesthetic with a timelessly elegant style that that complements the natural surroundings, whilst at the same time offering excellent privacy for total relaxation.</p>\r\n<p>&nbsp;</p>\r\n<p>Tourlos is one of the best regions on the island of Mykonos and it is a popular choice for many celebrities visiting Mykonos. It combines the best of worlds, with easy access to the nearby Mykonos town (Chora), but also offering great privacy and a variety of different entertainment options.</p>','About','','inherit','closed','closed','','16-revision-v1','','','2016-05-25 10:59:45.000','2016-05-25 10:59:45.000','',16,'http://www.villamykonosaquapearl.gr/2016/05/25/16-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (228,1,'2016-05-25 12:04:28.000','2016-05-25 12:04:28.000','<p style=\"text-align: left;\"><strong>Guests: 15 | Bedrooms: 8 | Bathrooms: 9</strong></p>\n<p>&nbsp;</p>\n<p>Villa Mykonos Aqua Pearl is built on a plot covering an area of 2300 m2. It is ideally located to provide stunning panoramic views of the sea and Mykonos island, and is also sheltered from Mykonos strong north summer winds called Meltemia. The villa has a 460 m2 building area spread in two levels, plus spacious outdoor grounds with a private swimming pool and dining area.</p>\n<p>&nbsp;</p>\n<p><br />\nAs you enter the property from the main driveway entrance, two parking spaces wait for your cars. Descending a few stairs, the guest walks through the stone entrance of the villa and down to the villas upper level. The entrance is through a large hall, leading to the dining room.</p>\n<p>&nbsp;</p>\n<p><br />\n On the right of the hall you will find a cozy living room with a fireplace. The living room opens out onto a large terrace with outdoor seating area and breathtaking views. On the left side of the hall, is the villas kitchen. This open plan kitchen is literally carved into the rock of the villa and light from the skylight washes in, bathing the room in warm Mediterranean sunshine. Next to the kitchen you can find the internal staircase.</p>\n<p>&nbsp;</p>\n<p><br />\nA few steps away and you will find yourself in one of four double bedrooms (all en-suite). This bedroom has its own entrance, allowing it to operate as a guest room or playroom. Going down, one can find the rest bedrooms.</p>\n<p>&nbsp;</p>\n<p><br />\nOutside the villa and descending the stairs of the terrace, the guest reaches the second level, which houses an outdoor dining area with a stone built table. Finally, descending to the infinity pool level, a large lounge area and the bar are waiting for you.\n</p>\n<p>&nbsp;</p>\n<p><br />\nWhichever level of Villa Mykonos Aqua Pearl you happen to be enjoying, the view of the Aegean Sea is always extraordinary and unforgettable!\n</p>','The Villa','','inherit','closed','closed','','18-autosave-v1','','','2016-05-25 12:04:28.000','2016-05-25 12:04:28.000','',18,'http://www.villamykonosaquapearl.gr/2016/05/25/18-autosave-v1/',0,'revision','',0);
