ide the villa and descending the stairs of the terrace, the guest reaches the second level, which houses an outdoor dining area with a stone built table. Finally, descending to the infinity pool level, a large lounge area and the bar are waiting for you.\r\n</p>\r\n<p>&nbsp;</p>\r\n<p><br />\r\nWhichever level of Villa Mykonos Aqua Pearl you happen to be enjoying, the view of the Aegean Sea is always extraordinary and unforgettable!\r\n</p>','The Villa','','inherit','closed','closed','','18-revision-v1','','','2016-05-25 12:06:33.000','2016-05-25 12:06:33.000','',18,'http://www.villamykonosaquapearl.gr/2016/05/25/18-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (230,1,'2016-05-25 12:20:46.000','2016-05-25 12:20:46.000','<p>The upper level of Villa Mykonos Aqua Pearl has a large living room with sofas and a fireplace. There is also a dining area for the whole party to enjoy meals together, and a guest WC The Upper Level is also home to the villas fully equipped open plan kitchen with a beautiful skylight. The Master Bedroom of the villa is also located on the upper level, and has its own private bathroom. There is also a double bedroom on this level too, also with its own private bathroom.</p>','Upper Level','','inherit','closed','closed','','20-revision-v1','','','2016-05-25 12:20:46.000','2016-05-25 12:20:46.000','',20,'http://www.villamykonosaquapearl.gr/2016/05/25/20-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (231,1,'2016-05-25 12:21:56.000','2016-05-25 12:21:56.000','<p>The lower level of Villa Mykonos Aqua Pearl has a spacious living room in which to relax and unwind, as well as a fully equipped home cinema room to keep everyone entertained. There are also 3 Master bedrooms, all with their own lounges and bathrooms. The lower level also houses a staff room with a single bed and ensuite bathroom. Outside, there is , one exterior guest room that uses the pool bathroom.\r\n</p>','Lower Level','','inherit','closed','closed','','22-revision-v1','','','2016-05-25 12:21:56.000','2016-05-25 12:21:56.000','',22,'http://www.villamykonosaquapearl.gr/2016/05/25/22-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (232,1,'2016-05-25 12:24:33.000','2016-05-25 12:24:33.000','<p>The villa\'s guest room is perfect for larger families or groups of friends. This beautiful double bedroom has its own en-suite as well as its own independent entrance, making it ideal as a playroom for kids, or a guest bedroom for teenagers or friends. The French doors also offer stunning sea views.</p>','Guest House','','inherit','closed','closed','','86-autosave-v1','','','2016-05-25 12:24:33.000','2016-05-25 12:24:33.000','',86,'http://www.villamykonosaquapearl.gr/2016/05/25/86-autosave-v1/',0,'revision','',0);
