INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (239,1,'2016-05-25 12:31:49.000','2016-05-25 12:31:49.000','<p>Villa Mykonos Aqua Pearl has a fabulous location in Tourlos, on the northwest coast of the Greek Cyclades island of Mykonos. It is just a few kilometres from the islands capital Chora, the fabulous sandy beach of Agios Stefanos, and Mykonos airport and port.</p>\r\n<p>&nbsp;</p>\r\n<p><br />\r\n<strong>Distances:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>To town:</strong> 2.9 km<br />\r\n<strong>To Ag. Stefanos beach:</strong> 2.8 km<br />\r\n<strong>To closest shop:</strong> 2.9 km<br />\r\n<strong>To Mykonos Airport:</strong> 4.6 Km<br />\r\n<strong>To new port:</strong> 2.3 km</p>','Location','','inherit','closed','closed','','12-revision-v1','','','2016-05-25 12:31:49.000','2016-05-25 12:31:49.000','',12,'http://www.villamykonosaquapearl.gr/2016/05/25/12-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (240,1,'2016-05-25 13:08:03.000','2016-05-25 13:08:03.000','<p>Villa Mykonos Aqua Pearl is a newly build 460 m2 villa, perched on the hill in Tourlos, in northwest Mykonos. The villa offers unobstructed panoramic views of the Aegean Sea, the new harbor, Mykonos town, and amazing sunsets views.</p>\r\n<p>&nbsp;</p>\r\n<p>The interior and exterior architectural design of Villa Mykonos Aqua Pearl combines a minimal modern aesthetic with a timelessly elegant style that that complements the natural surroundings, whilst at the same time offering excellent privacy for total relaxation.</p>\r\n<p>&nbsp;</p>\r\n<p>Tourlos is one of the best regions on the island of Mykonos and it is a popular choice for many celebrities visiting Mykonos. It combines the best of both worlds, with easy access to the nearby Mykonos town (Chora), but also offering great privacy and a variety of different entertainment options.</p>','About','','inherit','closed','closed','','16-revision-v1','','','2016-05-25 13:08:03.000','2016-05-25 13:08:03.000','',16,'http://www.villamykonosaquapearl.gr/2016/05/25/16-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (242,4,'2016-05-25 13:15:41.000','2016-05-25 13:15:41.000','<p>The lower level of Villa Mykonos Aqua Pearl has a spacious living room in which to relax and unwind, as well as a fully equipped home cinema room to keep everyone entertained. There are also 3 Master bedrooms, all with their own lounges and bathrooms. The lower level also houses a staff room with a single bed and ensuite bathroom. Outside, there is one exterior guest room that uses the pool bathroom.</p>','Lower Level','','inherit','closed','closed','','22-revision-v1','','','2016-05-25 13:15:41.000','2016-05-25 13:15:41.000','',22,'http://www.villamykonosaquapearl.gr/2016/05/25/22-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (243,1,'2016-05-25 13:22:13.000','2016-05-25 13:22:13.000','<p>The upper level of Villa Mykonos Aqua Pearl has a large living room with sofas and a fireplace. There is also a dining area for the whole party to enjoy meals together, and a guest WC The Upper Level is also home to the villas fully equipped open plan kitchen with a beautiful skylight. The Master Bedroom of the villa is also located on the upper level, and has its own en-s bathroom. There is also a double bedroom on this level too, also with its own private bathroom.</p>','Upper Level','','inherit','closed','closed','','20-autosave-v1','','','2016-05-25 13:22:13.000','2016-05-25 13:22:13.000','',20,'http://www.villamykonosaquapearl.gr/2016/05/25/20-autosave-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (244,1,'2016-05-25 13:22:50.000','2016-05-25 13:22:50.000','<p>The upper level of Villa Mykonos Aqua Pearl has a large living room with sofas and a fireplace. There is also a dining area for the whole party to enjoy meals together, and a guest WC The Upper Level is also home to the villas fully equipped open plan kitchen with a beautiful skylight. The Master Bedroom of the villa is also located on the upper level, and has its own en-suite bathroom. There is also a double bedroom on this level too, also with its own en-suite bathroom.</p>','Upper Level','','inherit','closed','closed','','20-revision-v1','','','2016-05-25 13:22:50.000','2016-05-25 13:22:50.000','',20,'http://www.villamykonosaquapearl.gr/2016/05/25/20-revision-v1/',0,'revision','',0);
INSERT INTO `tv_posts` (`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (245,1,'2016-05-26 12:18:39.000','2016-05-26 12:18:39.000','<p style=\"text-align: left;\"><strong>Guests: 15 | Bedrooms: 8 | Bathrooms: 9</strong></p><p>&nbsp;</p><p>Villa Mykonos Aqua Pearl is built on a plot covering an area of 2300 m2. It is ideally located to provide stunning panoramic views of the sea and Mykonos island, and is also sheltered from Mykonos strong north summer winds called Meltemia. The villa has a 460 m2 building area spread in two levels, plus spacious outdoor grounds with a private swimming pool and dining area.</p><p>&nbsp;</p><p>As you enter the property from the main driveway entrance, two parking spaces wait for your cars. Descending a few stairs, the guest walks through the stone entrance of the villa to reach the villas upper level. The entrance is through a large hall, leading to the dining room.</p><p>&nbsp;</p><p>On the right of the hall you will find a cozy living room with a fireplace. The living room opens out onto a large terrace with outdoor seating area and breathtaking views. On the left side of the hall, is the villas kitchen. This open plan kitchen is literally carved into the rock of the villa and light from the skylight washes in, bathing the room in warm Mediterranean sunshine. Next to the kitchen you can find the internal staircase.</p><p>&nbsp;</p><p>A few steps away and you will find yourself in one of four Master bedrooms (all en-suite). This bedroom has its own balcony with panoramic view of the Aegean Sea. Going down, at the lower level, one can find the rest Master bedrooms.</p><p>&nbsp;</p><p>Outside the villa the guest walk through the outdoor grounds to reach the Guest House. Finally, descending to the infinity pool level, a large lounge area , an outdoor dining area, a stone built table and the bar are waiting for you.</p><p>&nbsp;</p><p>Whichever level of Villa Mykonos Aqua Pearl you happen to be enjoying, the view of the Aegean Sea is always extraordinary and unforgettable!</p>','The Villa','','inherit','closed','closed','','18-revision-v1','','','2016-05-26 12:18:39.000','2016-05-26 12:18:39.000','',18,'http://www.villamykonosaquapearl.gr/2016/05/26/18-revision-v1/',0,'revision','',0);
